import React from 'react';
import Task from "../task/task";
import TaskToggle from "../task-toogle/task-toggle";

const TaskListItem = ({className}) => {
    if(className == 'completed') {
        return <li><Task label={className}/></li>
    }
    else if(className == 'editing') {
        return (<li>
                <Task className='view' label={className}/>
                <TaskToggle type="text" className="edit" value="Editing task"/>
             </li>);
    }
    else {
        return  <li><Task label={className}/></li>
    }



};

export default TaskListItem;
